INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[안내]OWNER_LA 이용방법', '오너님들께서 자신의 물품을 판매 등록하시면, 다른 오너님들께 등록된 상품이 보이기 시작합니다. 그 이후 구매하는 오너님이 생겨 거래가 발생할 때, 신뢰성과 안전의 확보를 위해 저희 OWNER_LA가 거래를 중개합니다. 그 이후 확실한 상품이 확인 되면 거래가 성사됩니다.', '2019/6/01');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[안내]OWNER_LA 이용수칙', '오너님들께 OWNER_LA 이용수칙을 안내드립니다. [1]모든 욕설과 비방은 금지됩니다. [2]모든 광고행위는 금지됩니다. [3]허위 상품을 올리는 행위는 금지됩니다.', '2019/6/01');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[이벤트]OWNER_LA 오픈 이벤트!', 'OWNER_LA 오픈 이벤트로 3개월간 거래 수수료가 50% 감면됩니다. 오너님들께서 많이 이용해주시면 감사하겠습니다.', '2019/6/01');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[필독]주의사항', '저희는 덕&울 로펌과 계약되어 있습니다. 허위 물품을 올리거나 하는 사기행위시 법적인 절차에 들어갑니다.', '2019/10/23');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[공지]작년 고소 사항', '경고에도 불구하고, 작년 한 해동안 10건의 고소를 진행하였습니다. 명심해 주시길 바랍니다.', '2020/1/1');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[이벤트]신년맞이 이벤트!', '작년 약 반년동안 많은 오너님들께서 저희 OWNER_LA를 이용해 주셨습니다. 감사드립니다. 이에 대한 감사의 의미로, 1개월간 거래 수수료 30% 감면됩니다. 올 한해도 잘 부탁드립니다. 오너님들, 새해 복 많이 받으세요!', '2020/1/1');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[안내]등급 안내', '저희 OWNER_LA에는 총 5개의 등급이 있습니다. 그 기준을 소개해 드리겠습니다. [BRONZE : 신규가입], [Silver : 10000point 이상], [Gold : 20000point 이상], [VIP : 30000point 이상], [VIP : 50000point 이상]   그에 따른 혜택은 각 등급 달성시 공개됩니다.', '2020/1/23');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[공지]올해 고소 현황', '지난 고소 사항 공지에도 불구하고, 올 첫 분기 동안에만 7건의 고소를 진행 하였거나 진행 중에 있습니다. 불이익 없으시도록 상품 올릴 때 주의해 주시길 바랍니다. 감사합니다.', '2020/4/01');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[이벤트]오너, 이리 오너라~', '저희 OWNER_LA를 늘 이용해 주시는 오너님들께 감사한 마음을 담아 이벤트를 진행합니다. 첫째, 1개월간 거래 수수료 20% 감면됩니다. 둘째, 1개월간 Point 적립이 2배로 늘어납니다. 오너님들께서 OWNER_LA에서 행복한 판매와 구매를 이루시길 기원합니다. 다시 한번 감사드립니다.', '2020/4/01');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[안내]VVIP 파티(2020/07/01)', '오너님들, 안녕하십니까? 다름이 아니라 저희 OWNER_LA에서 VVIP 등급을 달성하신 오너님들만 초대하여 파티를 진행할 예정에 있습니다. 누구보다 저희 OWNER_LA를 사랑해주시고 많이 이용해 주신 분들인 만큼, 저희도 그 사랑을 조금이라도 돌려드리고자 합니다. 하지만 VVIP는 아니시지만 저희 OWNER_LA를 이용해주시고 사랑해주시는 많은 오너님들께도 당연히 감사드리고 있습니다. 더 많은 오너님들께 혜택이 돌아가도록 준비 중에 있습니다. 오너님들, 늘 감사드립니다.', '2020/6/01');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[이벤트]KoreaITAcademy-신촌과 콜라버레이션 이벤트!', '오너님들, 안녕하십니까? 다름이 아니라 KoreaITAcademy-신촌과 콜라버레이션을 진행함에 따라 KoreaITAcademy-신촌에 다니시는 오너님들께 혜택이 부여됩니다. [1]모든 거래 수수료가 50% 감면됩니다. [2]학원비로 소모한 금액의 10%만큼 OWNER_LA Point로 적립됩니다. 오너님들께서 KoreaITAcademy-신촌과 저희 OWNER_LA에서 행복한 경험을 얻으시길 기원합니다. 늘 감사드립니다.', '2020/6/20');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[공지]VVIP 파티 후기', '오너님들 안녕하십니까? 많은 VVIP 분들께서 저희 OWNER_LA VVIP 파티에 참여해 자리를 빛내주셨습니다. 파티는 성공적으로 진행되었고, 오너님들께서도 진심으로 만족해 주셨습니다. 오너님들, 늘 감사드립니다. 사랑합니다!!', '2020/7/01');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[공지]OWNER_LA 서비스 발표(2020/07/20)', '저희 OWNER_LA가 오는 7월 20일, KoreaITAcademy-신촌지점에서 발표를 진행합니다. 저희의 서비스와 운영 방식, 구현 방식에 대해서 자세하게 설명드릴 예정입니다. 관심 있으신 오너님들께선 참여하여 자리를 빛내주시면 감사하겠습니다.', '2020/7/05');
INSERT INTO NOTICE VALUES(NOTICE_SEQ.NEXTVAL, 1, '[공지]OWNER_LA 서비스 발표 안내(2020/07/20)', '저희 OWNER_LA가 7월 20일, 바로 내일 KoreaITAcademy-신촌지점에서 발표를 진행합니다. 저번 공지에서 말씀드렸다싶이, 저희의 서비스와 운영 방식, 구현 방식에 대해서 자세하게 설명드릴 예정입니다. 관심 있으신 오너님들께선 참여하여 자리를 빛내주시면 감사하겠습니다. 참여해주신 오너님들께 드리는 소정의 상품도 준비하고 있습니다. 우리 오너님들, 늘 감사드립니다.', '2020/7/05');
